INSERT INTO `books` (`id`, `ISBN`, `auteur`, `illustrateur`, `category`, `nb_pages`, `editeur`, `pu_ht`, `tva`, `titre`, `description`, `image`, `stock`, `note`) VALUES
(21, '2221249941', 'Margaret Atwood', 'aucun', 'Science-Fiction', 576, 'Robert Laffont', 12.50, 5.5, 'La servante écarlate', 'On l\'appelle Defred. Quoique son nom, dans la machine normalisatrice qu\'est devenue la société de Gilead, n\'ait plus aucune importance. Ni sa personnalité. Aux yeux des fanatiques qui ont édifié le système, seul compte son ventre.\r\nDans ce monde clos à coup d\'interdictions, de persécutions et de diktats religieux, la maternité est réservée aux Servantes, réduites à cette seule fonction. Sinon, c\'est la déportation dans les colonies irradiées où croupissent les Antifemmes, bêtes noires du régime. Alors Defred se contraint à la soumission. Lutte pour oublier qu\'elle était libre, autrefois, dans un pays qui s\'appelait encore l\'Amérique...\r\nUn réquisitoire sans appel contre tous les intégrismes ; la peinture, implacable et minutieuse, d\'un monde qui pourrait être le nôtre, si...', './IMG/atwood.jpg', 53, NULL),
(22, '9788423334186', 'Victor Hugo', 'Inconnu', 'Aventure Fictif', 2598, 'Albert Lacroix et Cie', 3.50, 5.5, 'Les misérables', 'Les Misérables est un roman de Victor Hugo publié en 1862, l’un des plus vastes et des plus notables de la littérature du XIXᵉ siècle.', './IMG/hugo.jpg', 152, NULL),
(23, '9782226109972', 'Edgar Allan Poe', 'Horacio Lalia', 'Fantastique', 90, 'NicolaK', 0.00, 5.5, 'Le chat noirrrrr', 'C\'est le récit d\'un homme, le narrateur, qui cède à sa pulsion pour la perversion et l\'exerce sur son animal de compagnie favori: Pluton, son chat noir. C\'est le récit d\'un homme qui perd le contrôle sur sa vie, et est entraîné dans une spirale infernale le menant à son auto-destruction.', './IMG/poe.jpg', 10, NULL),
(24, '9782266239288', 'Poul Anderson', 'Aucun', 'Science-Fiction', 304, 'LE BÉLIAL', 2.00, 5.5, 'Tau Zéro', 'Le XXIIIe siècle...Imaginez 25 hommes et 25 femmes embarqués à bord du plus extraordinaire des vaisseaux spatiaux, le Leonora Christina, une nef capable de puiser son énergie au coeur même de l\'espace et de se déplacer aux frontières de la vitesse de la lumière. Sa destination : une étoile située à environ 30 années-lumière de la Terre.\r\nSi, du point de vue terrestre, le voyage durera 33 ans, du fait de la dilatation temporelle liée aux vitesses relativistes atteintes, pour les membres d\'équipage, le périple ne prendra que 5 années. Oui. Sauf que lors de la première partie du voyage, le système de décélération du vaisseau est gravement endommagé par un nuage de poussières interstellaires. Incapable de décélérer, le Leonora Christina se trouve condamné à une fuite en avant terrifiante, une plongée vers l\'inexorable, la vitesse de la lumière, le Tau Zéro. Dès lors, ce ne sont plus les secondes qui s\'écoulent en un clin d\'oeil, mais les siècles, les millénaires, les éons, bientôt, alors que le vaisseau traverse les galaxies et s\'enfonce toujours plus avant, au coeur de l\'univers...\r\nAu-delà du temps et de l\'espace, est-il encore seulement possible d\'envisager le moindre retour ?', './IMG/anderson.jpg', 7, NULL),
(25, '9782290308592', 'Clifford D. Simak', 'Inconnu', 'Science-Fiction', 311, 'J&#039;ai lu', 1.00, 5.5, 'Demain les chiens', 'La civilisation des chiens bruisse de mythes. Fondateur, celui de l&#039;homme est le plus répandu : on le raconte aux chiots pour les distraire, mais certains le considèrent intrinsèquement lié à l&#039;apparition de la race canine. Qui sait ? L&#039;éventuelle présence de l&#039;homme sur terre dans un lointain passé donne lieu à des spéculations et sert de base à huit contes formant suite sur l&#039;évolution des canidés depuis que les hommes ont abandonné leurs cités... et que l&#039;un d&#039;entre eux leur ait appris à parler. Chiens parlants, robots philosophes et mutants misanthropes se croisent, s&#039;évitent ou collaborent dans cette mini-saga en forme de fable d&#039;anticipation. L&#039;humanisme de Simak et son amour du vivant s&#039;épanouissent dans les cadres de son postulat : l&#039;homme n&#039;est qu&#039;une étape de l&#039;évolution des espèces, qu&#039;il contribue à accélérer à coups d&#039;idées et d&#039;inventions aussi loufoques que lourdes de conséquences. Et quand l&#039;humour surgit entre des lignes d&#039;un style fluide et imprégnant, on finit de se laisser porter par les paroles des chiens narrateurs. Le livre le plus célèbre, à juste titre, de Simak, est un concentré de clairvoyance et d&#039;habileté à trousser une histoire captivante d&#039;un bout à l&#039;autre. Si crédible que l&#039;on peut se surprendre , après l&#039;avoir lue, à converser avec le premier petit chien vous regardant avec dans les yeux cette lueur... de conscience ?', './IMG/simak.jpg', 57, NULL),
(26, '9782378762094', 'TJ Klune', 'De Saxus', 'Fantasy Littéraire', 468, 'De Saxus', 12.50, 5.5, 'Sous la porte qui chuchote', 'Bienvenue dans notre salon de thé La traversée de Charon.\r\nLe thé y est chaud, les scones bien frais et les morts, juste de passage.\r\nWallace Price n’est pas ce que l’on peut appeler « un personnage sympathique » … loin de là même. Vous ne pleurerez sûrement pas en apprenant qu’il vient de mourir.\r\nMais lorsqu’une femme se présentant comme une faucheuse vient le chercher à ses propres funérailles, Wallace a du mal à accepter son funeste destin.\r\nAu lieu de le conduire vers l’au-delà, la faucheuse l’emmène dans un petit village où se trouve un salon de thé pas comme les autres. Hugo, le patron de l’établissement, y aide les âmes à passer de l’autre côté. Wallace n’est absolument pas prêt à abandonner la vie qu’il a à peine vécue et avec l’aide de Hugo, il découvre enfin ce qui lui a manqué dans le passé.\r\nMais un jour, le Directeur - un être mystérieux et puissant - annonce à Wallace qu’il devra effectuer dans une semaine la traversée vers le monde des morts. Ce dernier entreprend alors de vivre toute une vie en sept jours. Y parviendra-t-il ?', './IMG/klune.jpg', 399, NULL),
(27, '9782266329729', 'Boris Quercia', 'Inconnu', 'Policier', 208, 'Pocket', 4.50, 5.5, 'Les rêves qui nous restent', 'Natalio est un classe 5, les flics les plus méprisés de la City, chargés d’éliminer discrètement les dissidents. Suite à un accident, il doit se procurer un nouvel « électroquant », robot d’apparence plus ou moins humaine qui lui sert d’assistant. Fauché, il se rabat sur un vieux modèle bas de gamme qui se distingue rapidement par l’inquiétante étrangeté de ses expressions et de ses réactions. Mais Natalio n’a pas le temps de s’interroger sur ces anomalies : il a un nouveau cas à résoudre. Une intrusion a eu lieu dans une de ces usines à rêves où se réfugient tant d’habitants de la City pour échapper à leurs vies misérables. Et des résultats lui sont demandés au plus vite…\r\nAprès la trilogie « Santiago Quiñones », Boris Quercia change d’univers et nous projette dans un futur digne d’un Philip K. Dick, gangrené par la marchandisation du vivant et la dépendance aux machines.', './IMG/quercia.jpg', 298, NULL),
(28, '2811239286', 'Jane Austen', 'Hugh Thomson', 'Romance', 380, 'Hauteville', 15.50, 5.5, 'Orgueil & préjugés', 'Mr et Mrs Bennett ont cinq filles à marier. À l’arrivée d’un nouveau et riche voisin, la famille espère que l’une d’entre elles pourra lui plaire… Au-delà des aventures sentimentales des cinq filles Bennett, Jane Austen dépeint les rigidités de la société anglaise au tournant du XIXe siècle. Le comportement et les réflexions d’Elizabeth Bennett, son personnage principal, révèlent les problèmes auxquels sont confrontées les femmes de la gentry campagnarde pour s’assurer sécurité financière et statut social : la solution passe en effet par le mariage.\r\nDrôle et romanesque, ce chef-d’oeuvre de Jane Austen continue à jouir d’une vive popularité et a donné lieu à de nombreuses adaptations.', './IMG/austen.jpg', 50, NULL);

